import React from 'react';
import { Parallax, Background } from 'react-parallax';
import img from './photo.jpg';

const Temp = () => (
    <div>
        {/* -----basic config-----*/}
        <Parallax
            blur={0}
            bgImage={img}
            bgImageAlt="the cat"
            strength={200}
        >
            <p style={{ background: "solid",
      padding: 20,
      position: "absolute",
      top: "50%",
      left: "50%",
      transform: "translate(-50%,-50%)",}}>
                </p>
            <div style={{ height: '800px' }} />
        </Parallax>
    </ div>        
)

export default Temp;
